import axios from "axios";
import environment from "./";

export const signInUser = (payload) => {
  return axios.post(
    env[process.env.NODE_ENV].api + "/accounts/login",
    payload
  );
};

export const registerUser = (payload) => {
  return axios.post(
    env[process.env.NODE_ENV].api + "/accounts/signup",
    payload
  );
};
